package com.muhammet.rabbitmq.producer;

import com.muhammet.rabbitmq.model.CreateUser;
import lombok.RequiredArgsConstructor;
import org.springframework.amqp.rabbit.core.RabbitTemplate;
import org.springframework.stereotype.Service;

@Service
@RequiredArgsConstructor
public class CreateUserProducer {

    private final RabbitTemplate rabbitTemplate;

    /**
     * Java da serileştirme işlemi var, bir datayı serileştirerek Base64 formatına çevirebilir ve bunu
     * iletebilirsiniz.
     * @param createUser
     */
    public void converdAndSendMessage(CreateUser createUser){
        rabbitTemplate.convertAndSend("exchange-auth","key-auth",createUser);
    }

    /**
     * data:image/jpeg;base64,
     */

}
